printf("Finish Stage 4\r\n");
printf("Stage 5 : Second MP \r\n");
#endif
	// maxpool
	maxpool(45, 64);
#ifdef ISDEBUG
printf("Finish Stage 5\r\n");
printf("Stage 6 : Flatten \r\n");
#endif
	// flatten
	flatten(64, 22);
#ifdef ISDEBUG
printf("Finish Stage 6\r\n");
printf("Stage 7 : FC1 \r\n");
#endif
	// Fully Connected Layers
	fully_connected(7, 1408);
#ifdef ISDEBUG
printf("Finish Stage 7\r\n");
printf("Stage 8 : FC2 \r\n");
#endif
	fully_connected(8, 128);
